// 成人、兒童口罩篩選
function btnShowMask() {
    let maskBtn = document.getElementById('fliterMask').getElementsByTagName('input');
    for (let i = 0; i < maskBtn.length; i++) {
        maskBtn[i].onclick = function () {
            switch (maskBtn[i].id) {
                case 'btn__adultMask':
                    updateStoreList('adult');
                    break;
                case 'btn__childMask':
                    updateStoreList('child');
                    break;
                default:
                    updateStoreList();
            }
        }
    }
}

